sys_variable_value.value:
(function execute(inputs, outputs) {

  var Response = false;

  var atualizarEstoque = new Aula_6();
  Response = atualizarEstoque.atualizarEstoque(inputs.parameter_material,inputs.parameter_solicitante,inputs.parameter_quantidade);

  outputs.parameter_response = Response;

})(inputs, outputs);

